                <div className="container">
                    <h1>Youth Login</h1>
                    <input type="text" placeholder="Email" />
                    <input type="password" placeholder="Password" />
                    <button>Login</button>
                    <Link to="/">Sign up here</Link>
                    
                </div>
            
        );
    }
}
